const AppSkeleton = () => {
    const renderCell = () => (
        <TableCell>
            <Skeleton variant="rect" height={20} />
        </TableCell>
    );

    const renderRow = () => (
        <TableRow>
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
        </TableRow>
    );

    return (
        <div>
            <div>
                <Skeleton variant="rect" height={50} />
            </div>
            <Container maxWidth={"lg"}>est</Container>
        </div>
    );
};

export default AppSkeleton;
